import React from 'react';
import {Link} from 'react-router-dom';

const News = (props) => {
  const { match } = props;

  return (
    <ul>
      {match.map((news, i) => (
        <li key={news.id} className="news-list">
          <Link
            to={{
              pathname: "/stories",
              state: {
                selectedNews: match
              }
            }}
          >
            <h6> {news.title} </h6>
          </Link>
        </li>
      ))}
    </ul>
  );
}

export default News;
